<blockquote>
<p>每个请求都在自己的goroutine中处理，处理程序经常要启动其他goroutine访问数据库或者是rpc服务，当一个请求被取消或者是处理超时时，在所有该请求上工作的goroutine都应该迅速退出，以便系统回收资源。</p>
</blockquote>
